import React from "react";

export default function Banner() {
  return (
      <div className="bg-[#ccfbf1] w-full py-[100px] text-center">
          
          <div className=" max-w-[1240px] py-[100px] mx-auto text-center font-bold">
              
              <div className="text-0.5xl font-bold mt-4">Learn with Us.</div>
              
              <h2 className="text-[#0f172a]  text-5xl  md:text font-bold text-[20px]">Grow with Us.</h2>
              
              <div className=" text-[20px] md:text-[50px] md:p-[24px] text-black">Learn</div>
              
      </div>
    </div>
  );
}
